var Table={create:function(a,f,c){f=f||2;c=c||0;var b=[];for(var e=0;e<f;e++){b.push([]);for(var d=0;d<a;d++){b[e].push(c)}}return b},show:function(a){for(var b=0;b<a.length;b++){console.log(a[b])}},h:function(a,b){b=b||0;return a[b]},v:function(a,d){d=d||0;var b=[];for(var c=0;c<a.length;c++){b.push(a[c][d])}return b},d1:function(a,f){f=f||0;var b=[];var d=a[0].length-a.length;if(f>0){for(var c=0;c<a.length-f+d;c++){b.push(a[c][c+f])}}else{if(f===0){for(var c=0;c<a.length-f;c++){b.push(a[c][c+f])}}else{f=Math.abs(f);for(var c=0;c<a.length-f;c++){b.push(a[c+f][c])}}}return b},d2:function(a,f){f=f||0;var b=[];var d=a[0].length-a.length;if(f>0){for(var c=0;c<a.length-f+d;c++){b.push(a[c][(a[0].length-1)-c-f])}}else{if(f===0){for(var c=0;c<a.length-f;c++){b.push(a[c][(a[0].length-1)-c-f])}}else{f=Math.abs(f);for(var c=0;c<a.length-f;c++){b.push(a[c+f][(a[0].length-1)-c])}}}return b},pattern:function(b,g,e){e=e||false;var a=[];var f=b.length;for(var d=0;d<f;d++){var c=Table.h(b,d).join("").indexOf(g);if(c!==-1){a.push(["h",d,c])}if(a[0]!==undefined){return a}var c=Table.v(b,d).join("").indexOf(g);if(c!==-1){a.push(["v",d,c])}if(a[0]!==undefined){return a}}for(var d=-f+1;d<f;d++){var c=Table.d1(b,d).join("").indexOf(g);if(c!==-1){a.push(["d1",d,c])}if(a[0]!==undefined){return a}var c=Table.d2(b,d).join("").indexOf(g);if(c!==-1){a.push(["d2",d,c])}if(a[0]!==undefined){return a}}if(a[0]===undefined){return false}else{return a}}};